      { id: 213, first_name: "Ayesha", last_name: "Khan", email: "ayesha.k@example.com" },
      { id: 214, first_name: "Tarun", last_name: "Desai", email: "tarun.d@example.com" },
      { id: 215, first_name: "Ritu", last_name: "Chopra", email: "ritu.c@example.com" },
    ]);

    // --- Sample Orders (23) ---
    await API.post(`/ingest/tenant/${tenantId}/orders`, [
      { id: 1001, total_price: "100.00", created_at: "2025-09-10T10:00:00Z", customer: { id: 201 }, line_items: [{ product_id: 101, quantity: 1, price: "25.00" }, { product_id: 102, quantity: 1, price: "75.00" }] },
      { id: 1002, total_price: "50.00", created_at: "2025-09-09T15:30:00Z", customer: { id: 202 }, line_items: [{ product_id: 101, quantity: 2, price: "25.00" }] },
      { id: 1003, total_price: "35.00", created_at: "2025-09-08T11:00:00Z", customer: { id: 203 }, line_items: [{ product_id: 103, quantity: 1, price: "35.00" }] },
      { id: 1004, total_price: "75.00", created_at: "2025-09-07T14:20:00Z", customer: { id: 204 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }] },
      { id: 1005, total_price: "60.00", created_at: "2025-09-06T12:00:00Z", customer: { id: 205 }, line_items: [{ product_id: 105, quantity: 1, price: "60.00" }] },
      { id: 1006, total_price: "45.00", created_at: "2025-09-05T09:20:00Z", customer: { id: 206 }, line_items: [{ product_id: 106, quantity: 1, price: "20.00" }, { product_id: 103, quantity: 1, price: "25.00" }] },
      { id: 1007, total_price: "135.00", created_at: "2025-09-04T14:55:00Z", customer: { id: 207 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }, { product_id: 105, quantity: 1, price: "60.00" }] },
      { id: 1008, total_price: "75.00", created_at: "2025-09-03T20:10:00Z", customer: { id: 208 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }] },
