      { id: 1017, total_price: "50.00", created_at: "2025-08-25T12:30:00Z", customer: { id: 205 }, line_items: [{ product_id: 101, quantity: 2, price: "25.00" }] },
      { id: 1018, total_price: "90.00", created_at: "2025-08-24T11:00:00Z", customer: { id: 206 }, line_items: [{ product_id: 103, quantity: 1, price: "35.00" }, { product_id: 104, quantity: 1, price: "55.00" }] },
      { id: 1019, total_price: "100.00", created_at: "2025-08-23T15:20:00Z", customer: { id: 207 }, line_items: [{ product_id: 101, quantity: 1, price: "25.00" }, { product_id: 102, quantity: 1, price: "75.00" }] },
      { id: 1020, total_price: "60.00", created_at: "2025-08-22T09:40:00Z", customer: { id: 208 }, line_items: [{ product_id: 105, quantity: 1, price: "60.00" }] },
      { id: 1021, total_price: "35.00", created_at: "2025-08-21T14:00:00Z", customer: { id: 209 }, line_items: [{ product_id: 103, quantity: 1, price: "35.00" }] },
      { id: 1022, total_price: "75.00", created_at: "2025-08-20T10:20:00Z", customer: { id: 210 }, line_items: [{ product_id: 102, quantity: 1, price: "75.00" }] },
      { id: 1023, total_price: "55.00", created_at: "2025-08-19T13:50:00Z", customer: { id: 211 }, line_items: [{ product_id: 104, quantity: 1, price: "55.00" }] },
    ]);

    await fetchData();
  } catch (err) {
    console.error(err);
    setError('Failed to ingest sample data. Check server logs.');
  } finally {
    setIngesting(false);
  }
};
